Minna-san, I am WeHateTeemo. I've missed you all, I'm so happy and sad to have found GD once again. I am such baka, I thought GD disappeared from the day boards were created.

Waaaaa, keep GD preasu!! Seriously I feel so disheartened right now, maybe the Rioters were right and GD should merge with a few sub-forums for noticibility; so long it is relevant! Keep GD onegai!! ;A;

-- I am not a weeb, I just really missed GD. I was really under the impression it died. :(
